import React from "react";
import AppBar from "@material-ui/core/AppBar/AppBar";
import clsx from "clsx";
import Toolbar from "@material-ui/core/Toolbar";
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Typography from "@material-ui/core/Typography";
import AccountCircle from '@material-ui/icons/AccountCircle';
import Switch from '@material-ui/core/Switch';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormGroup from '@material-ui/core/FormGroup';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import {LayoutUseStyles as useStyles} from "../LayoutUseStyles";

export default function AwBar(props) {
    const classes = useStyles();

    return (
        <>
            <FormGroup>
                <FormControlLabel
                    control={<Switch checked={props.auth} onChange={props.handleChange} aria-label="login switch"/>}
                    label={props.auth ? 'Logout' : 'Login'}
                />
            </FormGroup>
            <AppBar
                position="fixed"
                className={clsx(classes.appBar, {
                    [classes.appBarShift]: props.isAnchored,
                })}
            >
                <Toolbar>
                    <IconButton
                        color="inherit"
                        aria-label="open drawer"
                        onClick={props.handleDrawerOpen}
                        edge="start"
                        className={clsx(classes.menuButton, props.isAnchored && classes.hide)}
                    >
                        <MenuIcon/>
                    </IconButton>
                    <Typography variant="h6" noWrap>
                        Artworch
                    </Typography>

                    {props.auth && (
                        <div>
                            <IconButton
                                aria-label="account of current user"
                                aria-controls="menu-appbar"
                                aria-haspopup="true"
                                onClick={props.handleMenu}
                                color="inherit"
                            >
                                <AccountCircle/>
                            </IconButton>
                            <Menu
                                id="menu-appbar"
                                anchorEl={props.anchorEl}
                                anchorOrigin={{
                                    vertical: 'top',
                                    horizontal: 'right',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'right',
                                }}
                                open={props.isAnchored}
                                onClose={props.handleClose}
                            >
                                <MenuItem onClick={props.handleClose}>Profile</MenuItem>
                                <MenuItem onClick={props.handleClose}>My account</MenuItem>
                            </Menu>
                        </div>
                    )}

                </Toolbar>
            </AppBar>
        </>
    );
}
